import React, { useState } from "react";
import { useSelector, useDispatch} from "react-redux";
import { updateAdmin } from "./profile-reducer";

const ProfileComponent = () => {

    // const { admin } = useSelector((state) => state.admin);
    // const [profile, setProfile] = useState(admin);
    // const dispatch = useDispatch();
    // const handleSaveButton = () => {
    //     dispatch(updateAdmin(profile));
    // };

    const [profile, setProfile] = useState(
        {
            "firstName": "Jose",
            "lastName": "Annunziato", 
            "handle": "@jannunzi",
            "profilePicture": "/Users/tylerzhang/2023/spring/webdev/tuiter-react-web-app/public/images/Novak_400x400.jpeg", 
            "bannerPicture": "../public/images/AO_2023.jpeg",
            "bio": "Faculty, Software Engineer, AI, Space, and renewable enthusiast. Retuits and likes are not endorsements.",
            "website": "youtube.com/webdevtv",
            "location": "Boston, MA",
            "dateOfBirth": "7/7/1968",
            "dateJoined": "4/2009",
            "followingCount": 340,
            "followersCount": 223
        }
    );


    return (
        <div className="container">
            <h4>Admin Profile Component</h4>

            <div className="row">
                <i className="col-1 bi bi-arrow-left ms-3 mt-3"></i> 
                <span className="col-auto"> 
                    <h5> {profile.firstName} {profile.lastName} </h5>
                    <span>6.115 Tuits</span>
                </span>
            </div>
            <img src={profile.bannerPicture} />

            <br/>
            <img scr={profile.profilePicture} />
            <br/>


            <label>First Name</label><br />
            <input
                value={profile.firstName}
                onChange={(e) => setProfile({
                    ...profile,
                    firstName: e.target.value,
                })} /><br /><br />

            <label>Last Name</label><br />
            <input value={profile.lastName}
                onChange={(e) => setProfile({
                    ...profile,
                    lastName: e.target.value,
                })} /><br /><br />

            <label>Email</label><br />
            <input
                value={profile.email}
                onChange={(e) => setProfile({
                    ...profile,
                    email: e.target.value,
                })} /><br /><br />

            <label>Phone</label><br />
            <input
                value={profile.phone}
                onChange={(e) => setProfile({
                    ...profile,
                    phone: e.target.value,
                })} /><br /><br />

            <label>Address</label><br />
            <input
                value={profile.address}
                onChange={(e) => setProfile({
                    ...profile,
                    address: e.target.value,
                })} /><br /><br />
            {profile.firstName}
            <br/><br/>


        </div>
    );
};

export default ProfileComponent;
